import React, { useEffect, useReducer } from 'react';

import { VoterReducer } from '../../VoterReducer';

import '../../styles/ColorScheme.css';
import '../../styles/VoterDashboard.css';

function VoterDashboard() {
    const initialState = {
        isLoadingElections: false
    };

    const [state, dispatch] = useReducer(VoterReducer, initialState);

    useEffect(() => {
        console.log("in effect");
        setTimeout(() => {dispatch({ type: 'isLoadingElections', value: true });}, 3000);
        // dispatch({ type: 'isLoadingElections', value: true });
        console.log(state);
        dispatch({ type: 'retrieveVoterElections' });
        console.log(state);
    }, []);

    const content = state.isLoadingElections ? <div>loading</div> : <div>not loading</div>

    return (
        <div className="voter-dashboard-container">
            {content}
        </div>
    );
}

export default VoterDashboard;
